script: |
  super -f text -I q3996.spq | sort > q3996.out

inputs:
  - name: q3996.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE col1 * ( + col1 ) NOT BETWEEN ( ( + CAST ( 89 AS INTEGER ) ) / col0 ) AND + col0;
  - name: tab1

outputs:
  - name: q3996.out
    data: |
      51	14	96
      91	47	68
